public class InnerDashboardDefaultInteractiveLayoutConfigurationFactory(Action<Humidifier.QuickSight.DashboardTypes.DefaultInteractiveLayoutConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.QuickSight.DashboardTypes.DefaultInteractiveLayoutConfiguration>
{

    internal InnerDashboardDefaultFreeFormLayoutConfigurationFactory FreeFormFactory { get; set; }

    internal InnerDashboardDefaultGridLayoutConfigurationFactory GridFactory { get; set; }

    protected override Humidifier.QuickSight.DashboardTypes.DefaultInteractiveLayoutConfiguration Create()
    {
        var defaultInteractiveLayoutConfigurationResult = CreateDefaultInteractiveLayoutConfiguration();
        factoryAction?.Invoke(defaultInteractiveLayoutConfigurationResult);

        return defaultInteractiveLayoutConfigurationResult;
    }

    private Humidifier.QuickSight.DashboardTypes.DefaultInteractiveLayoutConfiguration CreateDefaultInteractiveLayoutConfiguration()
    {
        var defaultInteractiveLayoutConfigurationResult = new Humidifier.QuickSight.DashboardTypes.DefaultInteractiveLayoutConfiguration();

        return defaultInteractiveLayoutConfigurationResult;
    }
    public override void CreateChildren(Humidifier.QuickSight.DashboardTypes.DefaultInteractiveLayoutConfiguration result)
    {
        base.CreateChildren(result);

        result.FreeForm ??= FreeFormFactory?.Build();
        result.Grid ??= GridFactory?.Build();
    }

} // End Of Class

